import React from 'react'
// import './home.css'
import {
    MDBBtn,
    MDBNavbarLink
  } from 'mdb-react-ui-kit';
import Header from '../../components/header/header';
const Home = () => {
    return (
        <div>
              <Header></Header>
            <div class="featured-services"  style={{ padding: 200, border: "1px solid #555"}}>
                <div  style={{ border: "1px solid #555"}}>
                <h1 style={{marginBottom: 20}}>Featured Services</h1>
                <MDBNavbarLink >
              <MDBBtn
                rounded className='mx-2' color='black'
                href='services'
                style={{fontSize: 15}}
              >
                All Services
              </MDBBtn>
              </MDBNavbarLink>
                </div>

                <div  style={{ border: "1px solid #555"}}>
                    <h2>Service 1 ------------------ +</h2>
                    <h2>Service 2 ------------------ +</h2>
                    <h2>Service 3 ------------------ +</h2>
                    <h2>Service 4 ------------------ +</h2>
                </div>
            </div>
        </div>
    )
}

export default Home;
